window.bookSummaryJSON = "<p><b>Dragons. Destiny. Duty.</b></p> <p>The sum of my life. All that I am. Yet I wish to be more than that. I wish to be a worthy partner for my lovers.</p> <p>I now have immense prestige and power, more than I could ever have imagined. Yet all I truly want is Kirby and Harlen. Does that make me selfish?</p> <p>Those months we spent alone in the cottage together have become my touchstone; my strength and my hope for the future. For what do warriors fight for, if not a chance for peace and love?</p> <p>But the whole world is at stake, not just my happiness. I cannot afford to be selfish.</p> <p>There are enemies in every corner, and a dizzying dance of politics to play. I have dragon eggs to protect, my lovers to keep safe, and dragon riders to lead.</p> <p>War is brewing.</p> <p>Can I win, or am I destined to lose everything?</p> <p>DragonKing<i> is the third and final book of the DragonKin series. Each book picks up where the last left off, so they need to be listened to in order.</i></p>"; 
